			<Modal.Footer>
				<Modal.FooterControllers>
					{actionType === 'install' && <Button onClick={onInstallAnyway}>{t('Install_anyway')}</Button>}
					<Button primary onClick={() => handleOpenLink(GET_ADDONS_LINK)}>
						{t('Contact_sales')}
